CREATE TABLE `t_moni_metricbinding` (
  `c_id` char(36) NOT NULL COMMENT '指标绑定ID',
  `c_model_id` varchar(100) DEFAULT NULL COMMENT '监控模型ID',
  `c_metric_id` char(36) DEFAULT NULL COMMENT '指标ID',
  `c_className` varchar(500) DEFAULT NULL COMMENT '处理器类名',
  `c_method` varchar(200) DEFAULT NULL COMMENT '处理器方法名',
  `c_is_instance` tinyint(4) DEFAULT '-1' COMMENT '是否实例化',
  `c_is_initvalue` tinyint(4) DEFAULT '-1' COMMENT '是否初始化',
